import Link from "next/link"
import { useRouter } from "next/router"
import { useEffect, useState } from "react"

const 
    Router = useRouter(),
    [isActive, setIsActive] =useState([])

    useEffect(() => {
        const activeList = {
            profile: {
                active: Router.pathname === '/usuario/perfil' && 'active'
            },
            personalData: {
                active: Router.pathname === '/usuario/datos-personales' && 'active'
            },
            security: {
                active: Router.pathname === '/usuario/seguridad' && 'active'
            },
            configurations: {
                active: Router.pathname === '/usuario/configuraciones' && 'active'
            }
        }
        setIsActive(activeList)
    }, [Router])
import NavbarProfile from '../components/navbarProfile.component'

const UserProfile = () => {
    return(
        <>
        <article className="col-12">
            <NavbarProfile/>
        </article>
        <article className="contain-user-profile col-12">
            <h1>Mi perfil</h1>
        </article>
        </>
    )
}

export default UserProfile
